import React, { Component } from 'react'




export default class rateSort extends Component {
    
    render() {
        const {items,handleSort} = this.props;



        return (
            <div>
                <p>照評分排</p>
                <select  name="" id="" onChange={handleSort} defaultValue="highRate">
                    <option value="highRate">評分高到低</option>
                    <option value="lowRate">評分低到高</option>
                </select>
                
            </div>
        )
    }
}
